  return <button className="square"></button>;
}

function BoardRow() {
  return (
    <div style = {{display: "flex"}}>
      <Square />
      <Square />
      <Square />
    </div>
  );
}

export default function Board() {
  return (
    <>
      <BoardRow />
      <BoardRow />
      <BoardRow />
    </>
  );
}
